import './App.css';

import "./Button.css";

import { Route, Routes } from "react-router-dom";
import Login from "./Login";




function App(){
return(

<div className="all">
<Routes>
<Route path="/login" element={<Login />} />  

</Routes>

</div>
)

}

export default App
